import React from 'react';
import { List, Card, Tooltip } from 'antd';
import { DownloadOutlined, EditOutlined, ShareAltOutlined } from '@ant-design/icons';
import styles from './index.module.less';

const Applications = ({ list }) => {
    return (
        <List
            className={styles.filterCardList}
            rowKey="id"
            grid={{ gutter: 24, xxl: 3, xl: 2, lg: 2, md: 2, sm: 2, xs: 1 }}
            dataSource={list}
            renderItem={(item) => (
                <List.Item
                    key={item.id}
                >
                    <Card
                        hoverable
                        bodyStyle={{ paddingBottom: 20 }}
                        actions={[
                            <Tooltip key="download" title="download">
                                <DownloadOutlined />
                            </Tooltip>,
                            <Tooltip key="edit" title="edit">
                                <EditOutlined />
                            </Tooltip>,
                            <Tooltip key="share" title="share">
                                <ShareAltOutlined />
                            </Tooltip>,
                        ]}
                    >
                        asdf
                    </Card>
                </List.Item>
            )}
        />
    );
};

export default Applications;
